import React, { useState } from 'react';
import axios from 'axios';
import {Link} from "react-router-dom"

const ConsultationPage = () => {
  const [patient, setPatient] = useState('');
  const [date, setDate] = useState('');
  const [type, setType] = useState('');
  const [medicalCondition, setMedicalCondition] = useState('');
  const [notes, setNotes] = useState('');

  const handleSubmit = async (event) => {
    event.preventDefault();
    const token = localStorage.getItem('token');
    await axios.post('/api/consultations', {
      patient, date, type, medicalCondition, notes
    }, {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    });
  };

  return (
  <>
    <form onSubmit={handleSubmit}>
      <input value={patient} onChange={(e) => setPatient(e.target.value)} placeholder="Patient" />
      <input type="date" value={date} onChange={(e) => setDate(e.target.value)} />
      <input value={type} onChange={(e) => setType(e.target.value)} placeholder="Type" />
      <input value={medicalCondition} onChange={(e) => setMedicalCondition(e.target.value)} placeholder="Medical Condition" />
      <textarea value={notes} onChange={(e) => setNotes(e.target.value)} placeholder="Notes" />
      <button type="submit">Book Consultation</button>
    </form>
    <div className="w-full max-w-sm md:mx-[450px] mt-20 p-4 bg-white border border-gray-200 rounded-lg shadow sm:p-6 md:p-8 dark:bg-gray-800 dark:border-gray-700">
    <form className="space-y-6" action="#">
        <h5 className="text-xl font-medium text-gray-900 dark:text-white">SignUp in to our platform</h5>
        <div>
            <label for="name" className="block mb-2 text-sm font-medium text-gray-900 dark:text-white">Full Name</label>
            <input placeholder="Patient Name"  onChange={(e) => setPatient(e.target.value)}  name="email" className="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-600 dark:border-gray-500 dark:placeholder-gray-400 dark:text-white" required />
        </div>
        <div>
            <label for="type" className="block mb-2 text-sm font-medium text-gray-900 dark:text-white">Full Name</label>
            <input  onChange={(e) => setType(e.target.value)}  name="type" className="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-600 dark:border-gray-500 dark:placeholder-gray-400 dark:text-white" required />
        </div>
        <div>
            <label for="email" className="block mb-2 text-sm font-medium text-gray-900 dark:text-white">Your email</label>
            <input type="email" name="email" id="email" className="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-600 dark:border-gray-500 dark:placeholder-gray-400 dark:text-white"  required />
        </div>
        <div>
            <label for="Medical Condition" className="block mb-2 text-sm font-medium text-gray-900 dark:text-white">Your password</label>
            <input type="text"   className="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-600 dark:border-gray-500 dark:placeholder-gray-400 dark:text-white" required />
        </div>
        
        <button type="submit" className="w-full text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:outline-none focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 text-center dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800">SignUp</button>
        <div className="text-sm font-medium text-gray-500 dark:text-gray-300">
            Registered? <Link to={"/login"} className="text-blue-700 hover:underline dark:text-blue-500">Login</Link>
        </div>
    </form>
</div>
    </>
  );
};

export default ConsultationPage;
